import React, {memo, useEffect} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const IndexContainer = styled.div`
    width:100%;
    
    .contentWrap{
        max-width: 1200px;
        height: auto;
        margin:auto;

        .searchWrap{
            border:1px solid #B3B3B3;
            border-radius: 10px;
            padding:32px 50px;
            color:#333333;
            display: flex;
            align-items: center;
            justify-content: center;

            label{
                font-size:18px;
                font-weight: 500;
                margin-right:20px;
            }

            select, input {
                border:1px solid #959595;
                border-radius: 4px;
                height: 38px;
                margin-right:40px;
                padding:0 14px;
            }
            .keySearchWrap{
                .keySearch{
                    margin-right:0;
                }
            }
        }
    }

    
`;

const index = memo(() => {

    return (
        <IndexContainer>
            <Title title='취업지원' txt='취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.' />
            <div className='contentWrap'>
                <form className='searchWrap'>
                    <div className='regSearchWrap'>
                        <label for='regionSearch'>지역 검색</label>
                        <select className='regSearch' id='regionSearch'>
                            <option value='all'>전체</option>
                            <option value='고용노동부'>고용노동부</option>
                            <option value='서울특별시'>서울특별시</option>
                            <option value='인천광역시'>인천광역시</option>
                            <option value='대전광역시'>대전광역시</option>
                            <option value='세종특별자치시'>세종특별자치시</option>
                            <option value='대구광역시'>대구광역시</option>
                            <option value='부산광역시'>부산광역시</option>
                            <option value='광주광역시'>광주광역시</option>
                        </select>
                    </div>
                    <div className='titSearchWrap'>
                        <label for='titleSearch'>제목 검색</label>
                        <input type='text' id='titleSearch' className='titSearch' />
                    </div>
                    <div className='keySearchWrap'>
                        <label for='keywordSearch'>키워드 검색</label>
                        <input type='text' id='keywordSearch' className='keySearch' />
                    </div>
                </form>
            </div>
            
        </IndexContainer>
    );
});

export default index;
